export default class Message extends Component {
    state = {
        messageArr: [
            { id: '01', title: "消息1" },
            { id: '02', title: "消息2" },
            { id: '03', title: "消息3" }
        ]
    }
    render() {
        return (
            <div>
                <ul>
                    <li>
                        <a href="/message1">message001</a>&nbsp;&nbsp;
               </li>
                    <li>
                        <a href="/message2">message002</a>&nbsp;&nbsp;
               </li>
                    <li>
                        <a href="/message/3">message003</a>&nbsp;&nbsp;
               </li>
                </ul>
            </div>
        )
    }
}
